func healthFilter(health string) string {
	switch health {
	case "healthy":
		return "healthy"
	case "unhealthy":
		return "unhealthy"
	case "starting":
		return "starting"
	default:
		return "none"
	}
}

func hdStatColor(color string) string {
	switch color {
	case "primary":
		return "text-primary-400"
	case "green":
		return "text-green-400"
	case "red":
		return "text-red-400"
	case "yellow":
		return "text-yellow-400"
	case "gray":
		return "text-gray-400"
	default:
		return "text-gray-400"
	}
}

func healthCardBorder(health string) string {
	switch health {
	case "unhealthy":
		return "border-l-4 border-l-red-500"
	case "starting":
		return "border-l-4 border-l-yellow-500"
	case "healthy":
		return "border-l-4 border-l-green-500"
	default:
		return ""
	}
}

func healthStatusBg(health string) string {
	switch health {
	case "healthy":
		return "bg-green-500/20"
	case "unhealthy":
		return "bg-red-500/20"
	case "starting":
		return "bg-yellow-500/20"
	default:
		return "bg-gray-500/20"
	}
}

func stateClass(state string) string {
	switch state {
	case "running":
		return "bg-green-500/20 text-green-400"
	case "exited", "dead":
		return "bg-red-500/20 text-red-400"
	case "paused":
		return "bg-yellow-500/20 text-yellow-400"
	case "restarting":
		return "bg-blue-500/20 text-blue-400"
	default:
		return "bg-gray-500/20 text-gray-400"
	}
}

func logBgClass(exitCode int) string {
	if exitCode == 0 {
		return "bg-green-500/5 border border-green-500/20"
	}
	return "bg-red-500/5 border border-red-500/20"
}

